import styled from "styled-components";

export const Wrap = styled.div`
  max-height: 700px;
  position: relative;
`;

export const Text = styled.div`
  position: absolute;
  top: 50%;
  left: 25%;
  width: 50%;
  transform: translate(-50%, -50%);
  font-size: 21px;
  padding: 20px;
  color: black;
  background-color: white;
`;
